When planning to sell tokens to early investors and then use those funds to launch a token on a DeFi platform, you have several considerations to keep in mind. Here are the steps and best practices you should follow:

### Steps to Sell Tokens Privately and Use the Funds for Launching a DeFi Token

1. **Define Your Tokenomics:**
   - Determine the total supply of your token.
   - Define the distribution of the supply (e.g., pre-sale, presale, launch).
   - Decide the price per token for all phases.

2. **Create a Smart Contract for Token Sale:**
   - You can create a separate smart contract for the token sale. This contract will handle the pre-sale and presale phases.
   - Use a predefined percentage for the presale and launch phase.
   - Ensure that you can track the funds from the sale to the launchpad.

3. **Create a Smart Contract for the Launchpad:**
   - After receiving the funds from the sale, you will add the tokens to the launchpad.
   - Use a smart contract that integrates with the launchpad's API to transfer the tokens to the launchpad.

### Example Smart Contracts

#### Token Sale Smart Contract (PreSale)
```solidity
