pragma solidity ^0.8.0;

contract TokenSale {
    mapping(uint256 => bool) public saleStatus;
    uint256 public presaleTokenPercentage;
    uint256 public launchTokenPercentage;

    event PreSaleSent(address _seller, uint256 _tokens);
    event PreSaleClosed(address _seller, uint256 _tokens);

    constructor() {
        saleStatus[msg.sender] = true;
        presaleTokenPercentage = 0;
        launchTokenPercentage = 0;
    }

    function openSale(address _seller) public onlyOwner {
        saleStatus[msg.sender] = false;
        saleStatus[_seller] = true;
        presaleTokenPercentage = 100 * _seller;
        launchTokenPercentage = 100 * (100 - presaleTokenPercentage);
        transfer(_seller, presaleTokenPercentage * _uint256(0.1)); // 10% for presale, 90% for launch
    }

    function closeSale(address _seller, uint256 _tokens) public {
        saleStatus[msg.sender] = true;
        saleStatus[_seller] = false;
        presaleTokenPercentage = presaleTokenPercentage - _tokens;
        launchTokenPercentage = launchTokenPercentage + _tokens;
        transfer(_seller, presaleTokenPercentage * _uint256(0.1)); // 10% for presale, 90% for launch
    }

    function transfer(address _to, uint256 _amount) public {
        payable transfers[_to];
        uint256 amount = _amount;
        require(amount <= balanceOf(_to), "Sending more tokens than you have");
        require(saleStatus[_to] == true, "Transfer failed");

        transfers[_to] = amount;
        balanceOf(_to) -= amount;
        _to(_to + amount);
    }
}
```

#### Launchpad Integration (Launch)
```solidity
