pragma solidity ^0.8.0;

contract Launchpad {
    mapping(address => uint256) public tokenBalance;
    mapping(address => bool) public hasToken;

    event TokenLaunch(address _token, address _tokenOwner);

    constructor() {
        initializeTokenBalance();
    }

    function initializeTokenBalance() public {
        for (address public key in tokenBalance) {
            tokenBalance[key] = 0;
        }
    }

    function addToken(address _token, uint256 _tokenAmount) public {
        require(tokenBalance[_token] >= _tokenAmount, "Token already has enough balance");
        tokenBalance[_token] += _tokenAmount;
        emit TokenLaunch(_token, address(_token));
    }

    function transferToken(address _token, address _tokenOwner, uint256 _from, uint256 _to) public {
        require(tokenBalance[_token] >= _from, "Insufficient balance");
        require(tokenBalance[_token] >= _to, "Token not owned");
        require(saleStatus[_token] == true, "Transfer failed");

        tokenBalance[_token] -= _from;
        tokenBalance[_token] += _to;
        balanceOf(_tokenOwner) += _to - _from;

        require(hasToken[_tokenOwner], "Transfer failed");

        emit transferToken(_token, _tokenOwner, _from, _to);
    }
}
